// Fit the bounds of a Priority Area and its children. For now, the bbox
// property is manually set
function zoomTo(layerId) {
  priorityAreas.features.forEach(function(feature) {
    if (layerId == feature.properties.id) {
      map.fitBounds(feature.properties.bbox, {padding: 40});
    }
  });
}

// This function unnecessarily loops through all features of the layer's source
// this is due to the fact that breaks in js cannot be used within functions
// nested in a loop. Presently, it only gets run once on map load in
// createArclineLayers() so not an issue presently
function getLayerProperties(layerId) {
  let layer = map.getLayer(layerId);
  let result;
  if (layer.source == "priorityAreaSource") {
    priorityAreas.features.forEach(function(feature) {
      if (feature.properties.id == layerId) {
        result = feature.properties;
      }
    });
  } else if (layer.source == "causeVectorSource") {
    causeVectors.features.forEach(function(feature) {
      if (feature.properties.id == layerId) {
        result = feature.properties;
      }
    });
  }
  return result;
}

// create the on click listeners for the sidebar info
function createDetailListeners() {
  let count = infoContainer.childElementCount;
  for (var i = 0; i < count; i++) {
    let summaryElement = infoContainer.children[i].children[0];

    // TODO: Details/Summary has built in toggle functionality
    //       Update the click listeners to instead use toggle as shown in docs
    summaryElement.addEventListener("click", function (e) {
      let target = e.target;
      // if the the target is the currently selected PA &&
      // if the target is not a child of the currently selected PA
      if (selectedPAid == target.parentElement.id) {
        hideAllChildren();
        showPriorityAreas();
        selectedPAid = null;
      } else { // otherwise reset everything and open/select the target
        if (selectedPAid) {
          hideAllChildren();
          showPriorityAreas();
          document.getElementById(selectedPAid).open = false;
        }
        hideOtherPriorityAreas(e.target.parentElement.id);
        showChildren(e.target.parentElement.id);
        selectedPAid = e.target.parentElement.id;
        zoomTo(e.target.parentElement.id);
      }
    });

    let childCount = infoContainer.children[i].childElementCount;
    for (var j = 2; j < childCount; j++) {
        let childSummary = infoContainer.children[i].children[j].children[0];
        childSummary.addEventListener("click", function (e) {
          let target = e.target;
          // if the the target is the currently selected PA &&
          // if the target is not a child of the currently selected PA
          if (selectedCVid == target.parentElement.id) {
            hideChildren(selectedCVid);
            selectedCVid = null;
          } else { // otherwise reset everything and open/select the target
            if (selectedCVid) {
              hideChildren(selectedCVid);
              document.getElementById(selectedCVid).open = false;
            }
            showChildren(e.target.parentElement.id);
            selectedCVid = e.target.parentElement.id;
          }
        });
    }
  }
}

// Unhide the children and arclines (create them if necessary) of the passed layer
// TODO: make outline layer ids consistent with _arcline naming convention
function showChildren(parentId) {
  // loop through each causeVector and unhide it if its parent id matches
  // additionally create or unhide the arcs to the children
  causeVectors.features.forEach(function(feature) {
    if (feature.properties.parentId == parentId) {
      map.setLayoutProperty(feature.properties.id, "visibility", "visible");
      // check if the feature has an outline layer (i.e. if it's a polygon)
      if (map.getLayer(feature.properties.id + "Outline")) {
        map.setLayoutProperty(feature.properties.id + "Outline", "visibility", "visible");
      }
      // if arcline layer exists, unhide it
      if (map.getLayer(feature.properties.id + "_arcline")) {
        map.setLayoutProperty(feature.properties.id + "_arcline", "visibility", "visible");
      }
    }
  });
}

// Hide all chidren of the passed feature
function hideChildren(parentId) {
  causeVectors.features.forEach(function(feature) {
    if (feature.properties.parentId == parentId) {
      map.setLayoutProperty(feature.properties.id, "visibility", "none");
      map.setLayoutProperty(feature.properties.id + "_arcline", "visibility", "none");
      // hide the layer's outline if it has one
      if (map.getLayer(feature.properties.id + "Outline")) {
        map.setLayoutProperty(feature.properties.id + "Outline", "visibility", "none");
      }
    }
  });
}

// loop through and hide every Cause Vector
function hideAllChildren() {
  causeVectors.features.forEach(function(feature) {
    map.setLayoutProperty(feature.properties.id, "visibility", "none");
    if (map.getLayer(feature.properties.id + "_arcline")) {
      map.setLayoutProperty(feature.properties.id + "_arcline", "visibility", "none");
    }
  });
}

// Hide all Priority Areas (and their outlines) except the passed PA id
// TODO: test compare hiding vs very high opacity
function hideOtherPriorityAreas(priorityAreaId) {
  priorityAreas.features.forEach(function(feature) {
    if (feature.properties.id != priorityAreaId) {
      map.setLayoutProperty(feature.properties.id, "visibility", "none");
      if (map.getLayer(feature.properties.id + "Outline")) {
        map.setLayoutProperty(feature.properties.id + "Outline", "visibility", "none");
      }
    }
  });
}

// unhide all Priority Areas (and their outlines)
function showPriorityAreas() {
  priorityAreas.features.forEach(function(feature) {
    map.setLayoutProperty(feature.properties.id, "visibility", "visible");
    if (map.getLayer(feature.properties.id + "Outline")) {
      map.setLayoutProperty(feature.properties.id + "Outline", "visibility", "visible");
    }
  });
}

// create a mapbox polygon layer
// (due to webgl limitations, we need to use a duplicate line layer to outline)
// TODO: also pass a source and visiblity parameter to this function and use it
//       in createPriorityAreaLayers()
function addPolygonLayer(layerId) {
  map.addLayer({
    "id": layerId,
    "type": "fill",
    "source": "causeVectorSource",
    "filter": ["==", "id", layerId],
    "layout": {
      "visibility": "none"
    },
    "paint": {
      "fill-color": "red",
      "fill-opacity": 0.4
    }
  });
  map.addLayer({
    "id": layerId + "outline",
    "type": "line",
    "source": "causeVectorSource",
    "filter": ["==", "id", layerId],
    "layout": {
      "visibility": "none"
    },
    "paint": {
      "line-color": ["get", "stroke"],
      "line-width": 1
    }
  });
}

// create a mapbox line layer
function addLineLayer(layerId) {
  map.addLayer({
    "id": layerId,
    "type": "line",
    "source": "causeVectorSource",
    "filter": ["==", "id", layerId],
    "layout": {
      "line-cap": "round",
      "visibility": "none"
    },
    "paint": {
      "line-color": "blue",
      "line-width": 6,
      "line-opacity": 0.7
    }
  });
}

// create a mapbox circle layer
// TODO: rename to addCircleLayer for consistency
function addPointLayer(layerId) {
  map.addLayer({
    "id": layerId,
    "type": "circle",
    "source": "causeVectorSource",
    "filter": ["==", "id", layerId],
    "layout": {
      "visibility": "none"
    },
    "paint": {
      "circle-radius": 7,
      "circle-color": "black",
      "circle-opacity": 0.85
    }
  });
}

// Using the feature's name and headline property, create and return a
// detail & summary HTML element
function createDetailElement(feature, type) {
  let detailElement = document.createElement("details");
  let summaryElement = document.createElement("summary");
  let pElement = document.createElement("p");

  // The Detail elements contain the Id, but the summary elements contain the
  // click listeners
  detailElement.id = feature.properties.id;
  summaryElement.innerHTML = feature.properties.name;
  pElement.innerHTML = feature.properties.headline;

  // if feature is a first order Cause Vector
  if (type == "causeVector") {
    detailElement.classList.add("firstOrder");
  }

  detailElement.appendChild(summaryElement);
  detailElement.appendChild(pElement);

  return detailElement;
}

// Loop through each Priority Area and Cause Vector and call
// createDetailElement() on each, and append to DOM
function createDetailElements() {
  priorityAreas.features.forEach(function(feature) {
    // Populate the side bar info area with a list of the Priority Area names
    let detailElement = createDetailElement(feature, "priorityArea");
    infoContainer.appendChild(detailElement);
  });

  causeVectors.features.forEach(function(feature) {
    if (document.getElementById(feature.properties.id)) {
      // feature's HTML elements already exist; pass
    } else {
      let parentId = feature.properties.parentId;
      // if the parent's HTML elements exists
      if (document.getElementById(parentId)) {
        // create this feature's HTML elements
        let detailElement = createDetailElement(feature, "causeVector");
        let parentElement = document.getElementById(parentId);
        parentElement.appendChild(detailElement);
      } else {
        // the parent's HTML elements don't exist, so create them
        let parentLayer = getLayerProperties(parentId);
        let detailElement = createDetailElement(parentLayer, "causeVector");
        let parentElement = document.getElementById(parentLayer.properties.parentId)
        parentElement.appendChild(detailElement);

        // now we can create the current feature's HTML elements
        detailElement = createDetailElement(feature, "causeVector");
        parentElement = document.getElementById(parentId);
        parentElement.appendChild(detailElement);
      }
    }
  });
}

// Create a layer and generate listener objects for each Cause Vector
function createCauseVectorLayers() {
  causeVectors.features.forEach(function(feature) {
    // get & create the Ids that we need
    let layerId = feature.properties.id;
    let parentId = feature.properties.parentId;
    let childrenId = parentId + "CauseVectors";

    // create a mapbox layer depending on the feature's geometry type,
    switch(feature.geometry.type) {
      case "MultiPolygon":
      case "Polygon":
        addPolygonLayer(layerId);
        break;
      case "LineString":
        addLineLayer(layerId);
        break;
      case "Point":
        addPointLayer(layerId);
        break;
    }

    // create hover listener
    map.on("mouseenter", layerId, function(e) {
      map.getCanvas().style.cursor = "pointer";
      showChildren(layerId);
      // expand the CV's info in the sidebar
      document.getElementById(layerId).open = true;
    });

    // mouseleave listener
    map.on("mouseleave", layerId, function(e) {
      if (!selectedCVid || selectedCVid != layerId) {
        hideChildren(layerId);
        // close the CV's info in the sidebar
        document.getElementById(layerId).open = false;
      }
    });

    // on click:
    map.on("click", layerId, function(e) {
      let targetId = e.features[0].properties.id;
      if (selectedCVid === targetId) {
        hideChildren(targetId);
        // close the CV's info in the sidebar
        document.getElementById(layerId).open = false;
        selectedCVid = null;
      } else {
        showChildren(targetId);
        selectedCVid = e.features[0].properties.id;
        // expand the CV's info in the sidebar
        document.getElementById(layerId).open = true;
      }


      // // Populate the info area
      // let name = e.features[0].properties.name;
      // let description = e.features[0].properties.headline;

    })
  });
}

// Create a layer and generate listener objects for each Priority Area
function createPriorityAreaLayers() {
  priorityAreas.features.forEach(function(feature) {
    let layerId = feature.properties.id;
    let childrenId = layerId + "CauseVectors";

    map.addLayer({
      "id": layerId,
      "type": "fill",
      "source": "priorityAreaSource",
      "filter": ["==", "id", layerId],
      "paint": {
        "fill-color": ["get", "fill"],
        "fill-opacity": 0.7
      }
    });

    // decided to only use an outline for adani coal mine
    // TODO: when you extract this and the above add layer functionality to
    //       addPolygonLayer(), you can pass another boolean param "outline"
    // Due to a technical limitation of WebGL, outlines cannot be rendered with a
    // width > 1, so a seperate outline layer is needed
    if (layerId == "adaniCoalMine") {
      map.addLayer({
        "id": layerId + "Outline",
        "type": "line",
        "source": "priorityAreaSource",
        "filter": ["==", "id", layerId],
        "paint": {
          "line-color": ["get", "CO2_trend"],
          "line-width": ["get", "strokeWidth"],
          "line-opacity": ["get", "stroke-opacity"]
        }
      });
    }

    map.on("mouseenter", layerId, function(e) {
      // change to "select" cursor
      map.getCanvas().style.cursor = "pointer";
      // hide all the other PAs
      hideOtherPriorityAreas(layerId);
      // display the PA's Cause Vector children
      showChildren(layerId);
      // expand the PA's info in the sidebar
      document.getElementById(layerId).open = true;
    });

    map.on("mouseleave", layerId, function(e) {
      // reset the cursor type
      map.getCanvas().style.cursor = '';
      //
      if (!selectedPAid) {
        // hide PA's Cause Vector children
        hideChildren(layerId);
        showPriorityAreas();
        // close the PA's info in the sidebar
        document.getElementById(layerId).open = false;
      }
    });

    map.on("click", layerId, function(e) {
      // If we clicked on the selected Priority Area
      if (selectedPAid) {
        hideAllChildren();
        // close the PA's info in the sidebar
        document.getElementById(selectedPAid).open = false;
        selectedPAid = null;
      } else {
        selectedPAid = e.features[0].properties.id;
        zoomTo(layerId);
        showChildren(layerId);
        // expand the PA's info in the sidebar
        document.getElementById(layerId).open = true;
      }
    });
  });
}

// this function creates the arcs between features
function createArcline(feature, start, end) {
  try {
    let coords;

    // We need some logic here to handle an edge case. Picture a mercator map
    // and imagine the start point is at the western edge of the map and the end
    // point is at the eastern edge. By default mapbox will draw a line all the
    // way across the map instead of taking the short route by jumping across
    // the 180th meridian. Issue is discussed here:
    // https://github.com/mapbox/mapbox-gl-js/issues/3250

    // if the start is at the west edge and the end is at the east edge
    if (start[0] < -160 && end[0] > 30 ) {
      // then replace the end's longitude with (180 - end.longitude)
      // this essentially pushes the point past 180 or (-180)
      coords = [start, [-180 - (180 - end[0]), end[1]]]
    } else {
      coords = [start, end];
    }

    let arcline = {
      "type": "FeatureCollection",
      "features": [
        {
          "type": "Feature",
          "geometry": {
            "type": "LineString",
            "coordinates": coords
          }
        }
      ]
    };

    // Now create an arcline based on:
    // https://docs.mapbox.com/mapbox-gl-js/example/animate-point-along-route/

    // Calculate the distance in kilometers between route start/end point.
    let lineDist = turf.lineDistance(arcline.features[0], "kilometers");

    let arc = [];

    // Number of steps to use in the arc and animation, more steps means
    // a smoother arc and animation, but too many steps will result in a
    // low frame rate
    // !! we aren't using an animation yet, but is something I'd like to incorporate !!
    let steps = 500;

    // Draw an arc between the `origin` & `destination` of the two points
    for (var i = 0; i < lineDist; i += lineDist / steps) {
      let segment = turf.along(arcline.features[0], i, "kilometers");
      arc.push(segment.geometry.coordinates);
    }

    // Update the route with calculated arc coordinates
    arcline.features[0].geometry.coordinates = arc;

    // Source & layer name
    let sourceName = feature.properties.id + "_arcline";
    map.addSource(sourceName, {
      "type": "geojson",
      "data": arcline
    });
    map.addLayer({
      "id": sourceName,
      "source": sourceName,
      "type": "line",
      "layout": {
        "visibility": "none"
      },
      "paint": {
        "line-width": feature.properties.strokeWidth,
        "line-color": "red"
      }
    });
  } catch(error) {
    console.error(feature.properties, error)
  }
}

// Create the arcline connections for all cause vectors
// this is called after the map is done loading
function createArclineLayers() {
  causeVectors.features.forEach(function(feature) {
    let parentProperties = getLayerProperties(feature.properties.parentId);
    // TODO: make this its own function
    switch(feature.geometry.type) {
      case "MultiPolygon":
      case "Polygon":
        createArcline(feature, parentProperties.center, feature.properties.center);
        break;
      case "LineString":
        // first feature in linestrings (rivers) are the end/mouth of the river
        createArcline(feature, parentProperties.center, feature.geometry.coordinates[0]);
        break;
      case "Point":
        createArcline(feature, parentProperties.center, feature.geometry.coordinates);
        break;
    }
  });
}

